gqm(){return"Deto is ontwikkeld en bedacht voor u, de app moet een nuttig hulpmiddel voor u zijn en u een platform bieden voor de centrale collectie en publicatie van uw politiek gemotiveerde evenementen, dus ieder van ons heeft nu de mogelijkheid om onze eigen evenementen te plannen en te publiceren, en dus uw evenementen zo centraal en gemakkelijk mogelijk toegankelijk mogelijk om aan een groot publiek te worden gepresenteerd om te bekijken.\n\nDeto richt zich primair op politiek, democratisch gemotiveerde gebeurtenissen, maar de app biedt u ook de mogelijkheid om niet-politieke evenementen te cre\xebren en te publiceren.\n\nU kunt uw evenementen delen of uw sociale / livestream -platforms storten, of melding krijgen over aankomende evenementen en nog veel meer ...\n\nWe hopen dat we een klein deel hebben kunnen bijdragen aan de democratische ontwikkeling met onze app, en we zijn erg blij als je onze app gebruikt en het aanbeveelt als je het leuk vindt.\n\nAls u vragen, verzoeken of suggesties voor verbetering hebt, kunt u het contactformulier in het scherm Over gebruiken of gewoon onze telegramgroep T.ME./DETO-APP_GROUP invoeren of het kanaal t.me/deto_app_channel/ bezoeken. en abonneren.\n\nWe wensen u elk succes bij het maken en hosten van uw evenementen, we hopen dat u veel plezier hebt met uw Deto -app.\n\nOpmerking: Selecteer de voorkeurstaal en de thema -optie, om door te gaan, moet u het selectievakje onderaan bevestigen\n\nUw deto -team"},
